import React from 'react';
import { Link } from 'react-router-dom';

const Checkout = ({ step1, step2, step3, step4 }) => {
  return (
    <div className="checkout-steps">
      <div className={step1 ? 'active' : ''}><Link to="/login">Sign In</Link></div>
      <div className={step2 ? 'active' : ''}><Link to="/shipping">Shipping</Link></div>
      <div className={step3 ? 'active' : ''}><Link to="/payment">Payment</Link></div>
      <div className={step4 ? 'active' : ''}><Link to="/placeorder">Place Order</Link></div>
    </div>
  );
};

export default Checkout;
